import React from 'react';
import { Code, Markup, Text, PlusGrid, PlusGridItem } from 'components';
import { Utils } from 'utils';
import { ParametersProps } from './parameters.types';
import styles from './parameters.module.scss';

export const Parameters: React.FC<ParametersProps> = ({ items = [] }) => {

  const hasDefault = !!items.filter((item) => typeof item.default !== 'undefined').length;

  const hasType = !!items.filter((item) => typeof item.type !== 'undefined').length;

  const hasValue = !!items.filter((item) => typeof item.value !== 'undefined').length;

  const classes = Utils.classes({
    [styles.parameters]: true,
  });

  return (
    <div className={classes}>
      {items.map((item, index, items) => (
        <PlusGrid key={item.name}>
          <PlusGridItem xs="grow">
            <Text size="body">Name</Text>
            <Text size="body" color="error">{item.name}</Text>
          </PlusGridItem>
          <PlusGridItem xs="12" sm="6" lg="grow">
            {hasType && <Text size="body">Type</Text>}
            {hasType && <Text size="body">{item.type}</Text>}
          </PlusGridItem>
          <PlusGridItem class="default" xs="12" lg="auto">
            {hasDefault && <Text size="body">Default</Text>}
            {hasDefault && <Text size="body">{item.default}</Text>}
          </PlusGridItem>
          <PlusGridItem xs="12">
            <Text size="body">Description</Text>
            <Text size="body">
              <Markup ignoreParagraph>{item.description}</Markup>
            </Text>
          </PlusGridItem>
          {hasValue && (
            <PlusGridItem xs="12">
              <Text size="body">Value</Text>
              {/* TODO */}
              <Code language="js">{item.value}</Code>
            </PlusGridItem>
          )}
        </PlusGrid>
      ))}
    </div>
  );
};
